import React from 'react';

const PlaceholderImage = ({ className = '' }) => {
  const placeholderDataUrl = 'data:image/svg+xml;base64,';

  return (
    <img
      src={placeholderDataUrl}
      alt="No Image Available"
      className={className}
    />
  );
};

export default PlaceholderImage;
